import React, { useState } from 'react'
import { Link, useNavigate } from "react-router-dom"
import Navbar from '../components/navbar'
import Footer from '../components/footer'
const currentYear = new Date().getFullYear();

export default function Signup() {
  let navigate = useNavigate()
  const [inputs, setInputs] = useState({
    title: "",
    content: "",
    image: "",
    author:""
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log(inputs)
  //   try {
  //     const response = await fetch('http://localhost:4000/api/createUser', {
  //       method: 'POST',
  //       headers: {
  //         'Content-Type': 'application/json'
  //       },
  //       body: JSON.stringify({ username: credentials.username, email: credentials.email, password: credentials.password })
  //     });

  //     if (response.ok) {
  //       const data = await response.json();
  //       console.log(data); // Handle success response

  //       navigate("/");
  //       alert("Yay! Your Account has been Created Successful.")
  //     } else if (response.status === 409) {
  //       alert('User already exists,Login now'); // User exists alert
  //     }
  //     else {
  //       alert("Enter correct E-mail ID or Password")
  //       throw new Error('Failed to create user');
  //     }
  //   } catch (error) {
  //     console.error(error); // Handle error
  //   }
  // };

  const onChange = (e) => {
    setInputs({ ...inputs, [e.target.name]: e.target.value });
  };


  return (
    <>
      <Navbar />
      <div className="flex min-h-full flex-1 flex-col justify-center px-6 py-12 lg:px-8">
        <div className="sm:mx-auto sm:w-full sm:max-w-sm">
          <h2 className="mt-10 text-center text-2xl font-bold leading-9 tracking-tight text-gray-900">
             Create new Blog
          </h2>
        </div>

        <div className="mt-10 sm:mx-auto sm:w-full sm:max-w-sm">
          <form className="space-y-6" onSubmit={handleSubmit}>
            <div>
              <label htmlFor="text" className="block text-sm font-medium leading-6 text-gray-900">
                Title
              </label>
              <div className="mt-2">
                <input
                  id="name"
                  name="title"
                  type="text"
                  value={inputs.title}
                  onChange={onChange}
                  autoComplete="name"
                  required
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                />
              </div>
            </div>
            <div>
              <label htmlFor="text" className="block text-sm font-medium leading-6 text-gray-900">
                Content
              </label>
              <div className="mt-2">
                <input
                  id="email"
                  name="content"
                  type="email"
                  value={inputs.content}
                  onChange={onChange}
                  autoComplete="email"
                  required
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                />
              </div>
            </div>

            <div>
              <div className="flex items-center justify-between">
                <label htmlFor="text" className="block text-sm font-medium leading-6 text-gray-900">
                  Imgae
                </label>
              </div>
              <div className="mt-2">
                <input
                  id="password"
                  name="image"
                  type="password"
                  value={inputs.image}
                  onChange={onChange}
                  autoComplete="current-password"
                  required
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                />
              </div>
            </div>
            <div>
              <div className="flex items-center justify-between">
                <label htmlFor="text" className="block text-sm font-medium leading-6 text-gray-900">
                  Author
                </label>
              </div>
              <div className="mt-2">
                <input
                  id="password"
                  name="author"
                  type="password"
                  value={inputs.author}
                  onChange={onChange}
                  autoComplete="current-password"
                  required
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6"
                />
              </div>
            </div>

            <div>
              <button
                type="submit"
                className="flex w-full justify-center rounded-md bg-indigo-600 px-3 py-1.5 text-sm font-semibold leading-6 text-white shadow-sm hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
              >
                Create Blog Now
              </button>
            </div>
          </form>
        </div>
      </div>
      <Footer />
    </>

  )
  }
}
